import React from "react";
import Navbar from "../components/Navbar";
import { MainPage, CataloguePage } from "../pages";

import { Route, Routes } from "react-router-dom";

const App = () => {
    return (
        <div>
            <Navbar/>
            <div className="container">
            <Routes>
                <Route path="/"
                    element={<MainPage/>}/>
                <Route path="/cat" element={<CataloguePage/>}/>
                <Route path="/cat/:id" element={<div>{this.state.id}</div>}/>
            </Routes>
            </div>
        </div>
    )
}

export default App;
